(window.webpackJsonp=window.webpackJsonp||[]).push([[39],{"./app/data/blogs/error-421.md":function(A,a,o){A.exports="<h3 id=->问题出现</h3> <p>开发反馈错误时间过长</p> <p>发现所有错误请求都被发送了两次，情况是</p> <ul> <li><p>浏览器中发现只有一次请求</p> </li> <li><p>服务器上发现有两条请求日志</p> </li> </ul> <h3 id=->排查过程</h3> <p>首先为乐确认问题是在nginx转发时发生的，还是由浏览器发送的</p> <p>只能使用抓包的方式进行排查，重新修改了服务器，关闭了https</p> <p>使用wireshark进行抓包</p> <pre class=hljs><code class=language-auto>ip == <span class=hljs-number>10.1</span><span class=hljs-number>.108</span><span class=hljs-number>.31</span> &amp;&amp; ip.port = <span class=hljs-number>80</span> &amp;&amp; http</code></pre><p>检查发现是由浏览器发送了两次请求</p> <p>分别使用了不同浏览器测试：</p> <ul> <li>Firefox 两次</li> <li>Chrome 两次</li> <li>Safari 正常</li> <li>IE 正常</li> </ul> <p>检查了请求和响应</p> <p>查看chrome网络waterfall</p> <p><img src="+o("./app/data/blogs/error-421/time.png")+' alt=""></p> <p>查看发现，时间显示stalled时有一次请求</p> <p>之后walting时间段是重试的请求</p> <p>测试了是否是keepalive的原因，<code>nginx.conf</code>设置：</p> <pre class=hljs><code class=language-nginx><span class=hljs-attribute>keepalive_timeoute</span> <span class=hljs-number>0</span>;</code></pre><p>排除原因</p> <p>使用了<a href=https://github.com/gsmlg/echo><code>echo</code></a>服务进行测试</p> <p>通过测试发现，当服务器响应421时，浏览器会复制请求并再次请求服务器</p> <h3 id=->原因</h3> <p>查看了 <code>http status code 421</code> 说明</p> <pre class=hljs><code class="language-undefined">  <span class=hljs-number>421</span> Misdirected Request （RFC <span class=hljs-number>7540</span>）\n    该请求针对的是无法产生响应的服务器（例如因为连接重用）。</code></pre><p>RFC 7540 Hypertext Transfer Protocol Version 2 (HTTP/2) <a href=https://tools.ietf.org/html/rfc7540>链接</a></p> <p>指定说明<a href=https://tools.ietf.org/html/rfc7540#section-9.1.2>Section</a></p> <pre class=hljs><code class="language-undefined">  9.1.2.  The 421 (Misdirected Request) Status Code\n\n  The 421 (Misdirected Request) status code indicates that the request\n  was directed at a<span class=hljs-built_in> server </span>that is <span class=hljs-keyword>not</span> able <span class=hljs-keyword>to</span> produce a response.\n  This can be sent by a<span class=hljs-built_in> server </span>that is <span class=hljs-keyword>not</span> configured <span class=hljs-keyword>to</span> produce\n  responses <span class=hljs-keyword>for</span> the combination of scheme <span class=hljs-keyword>and</span> authority that are\n  included <span class=hljs-keyword>in</span> the request URI.\n\n  Clients receiving a 421 (Misdirected Request) response <span class=hljs-keyword>from</span> a<span class=hljs-built_in> server\n</span>  MAY retry the request -- whether the request method is idempotent <span class=hljs-keyword>or</span>\n  <span class=hljs-keyword>not</span> -- over a different connection.  This is possible <span class=hljs-keyword>if</span> a<span class=hljs-built_in> connection\n</span>  is reused (Section 9.1.1) <span class=hljs-keyword>or</span> <span class=hljs-keyword>if</span> an alternative<span class=hljs-built_in> service </span>is selected\n  [ALT-SVC].\n\n  This status code MUST <span class=hljs-keyword>NOT</span> be generated by proxies.\n\n  A 421 response is cacheable by default, i.e., unless otherwise\n  indicated by the method definition <span class=hljs-keyword>or</span> explicit cache controls (see\n  Section 4.2.2 of [RFC7234]).</code></pre><h4 id=->确定原因</h4> <p>http2中定义了421错误</p> <h5 id=421-http2-http2-421->421错误用于在http2中，在http2复用连接时，发现连接到的服务器不正确，则会由服务器返回响应码421，客户端收到后会重新建立连接并且发送相同的请求</h5> <h3 id=->解决方式</h3> <p>使用通用的错误响应码<code>403</code>即可解决问题</p> '},"./app/data/blogs/error-421/time.png":function(A,a){A.exports="data:image/png;base64,"}}]);